import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
  useLocation
} from "react-router-dom";
import Home, { Base, SignIn, SignUp} from "./views/Home"
import './App.css';

function App() {

        return (
          <Router>
          <div id='container'>
              <Base/>
              <Switch>
                  <Route path="/signin">
                      <SignIn />
                  </Route>
                  <Route path="/signup">
                      <SignUp />
                  </Route>
                  <Route path="/">
                      <Home/>
                  </Route>
              </Switch>
          </div>
      </Router>

        );
}

export default App;
